    def add_column_parity(self):
        parity = [0] * (Troika.SLICES * Troika.COLUMNS)

        # compute parity for each column
        for slice in range(Troika.SLICES):
            for col in range(Troika.COLUMNS):
                col_sum = 0
                for row in range(Troika.ROWS):
                    col_sum += self.state(Troika.SLICESIZE * slice + Troika.COLUMNS * row + col)
                parity[Troika.COLUMNS * slice + col] = col_sum % 3

        # add parity
        for slice in range(Troika.SLICES):
            for row in range(Troika.ROWS):
                for col in range(Troika.COLUMNS):
                    index = Troika.SLICESIZE * slice + Troika.COLUMNS * row + col
                    sum_to_add = parity[(col - 1 + 9) % 9 + Troika.COLUMNS * slice] + parity[(col + 1) % 9 + Troika.COLUMNS * ((slice + 1) % Troika.SLICES)]
                    self.state[index] = (self.state[index] + sum_to_add) % 3


    def add_round_constant(self, round):
        for slice in range(Troika.SLICES):
            for col in range(Troika.COLUMNS):
                index = Troika.SLICESIZE * slice + col
                self.state[index] = (self.state[index] + Troika.ROUND_CONSTANTS[round][slice * Troika.COLUMNS + col]) % 3

    def print_slice(self, slice):
        print('#### Slice {} ####'.format(slice))
        for row in range(Troika.ROWS):
            for column in range(Troika.COLUMNS):
                print('{} '.format(self.state[slice * Troika.SLICES + row * Troika.COLUMNS + column]), end='')
            print('')
        print('------------------')
        for i in range(Troika.COLUMNS):
            print('{} '.format((
                self.state[slice * Troika.SLICES + 0 * Troika.COLUMNS + i] +
                self.state[slice * Troika.SLICES + 1 * Troika.COLUMNS + i] +
                self.state[slice * Troika.SLICES + 2 * Troika.COLUMNS + i]
            ) % 3), end='')
        print('')

    def print_state(self):
        for s in range(Troika.SLICES):
            self.print_slice(s)


